description:
An American ranch owner sends his son Bob and daughter Kathy to Australia to manage a cattle station. Once there, Bob's racist attitudes cause a lot of bad feelings and conflicts. Meanwhile, Billy Graham is in Australia preaching. Will Bob have a change of heart, and at what price?

This was produced by Billy Graham's World Wide Pictures. It was directed by Dick Ross ([url=http://cinemageddon.net/details.php?id=151949]Oiltown USA[/url], [url=http://cinemageddon.net/details.php?id=144465]The Restless Ones[/url]) and stars Georgia Lee, Dickie Jones, Jimmy Little, Marcia Hathaway, Ken Fraser, Keith Buckley, Vaughan Tracey. 

